import React from "react";

const RentalInfo = ({ rental }) => {
  const {} = rental;
  return (
    <div className="RentalInfos">
      <h2>{rental.subtitle}</h2>
      <p>
        {rental.guests} {rental.guests === 1 ? "guest" : "guests"} •{" "}
        {rental.bedrooms} {rental.bedrooms === 1 ? "bedroom" : "bedrooms"} •{" "}
        {rental.beds}
        {rental.beds === 1 ? "bed" : "beds"} •{rental.bathrooms}{" "}
        {rental.bathrooms === 1 ? "bathroom" : "bathrooms"}
      </p>
      <br />
      <hr />
      {rental.arrivalDetails ? <h2>{rental.arrivalDetails}</h2> : ""}
      <br />
      {rental.cleanDetails ? <h2>{rental.cleanDetails}</h2> : ""}
      <br />
      {rental.checkInDetails ? <h2>{rental.checkInDetails}</h2> : ""}
      <br />
      <hr />
      <br />
      <h3>{rental.description}</h3>
      <br />
      {rental.spaceDescription ? (
        <h3>
          <strong>The space</strong>
          <br />
          <div> {rental.spaceDescription}</div>
        </h3>
      ) : (
        ""
      )}
      <br />
      {rental.guestsAccessDescription ? (
        <h3>
          <strong>Guest access</strong>
          <br />
          <div>{rental.guestsAccessDescription}</div>
        </h3>
      ) : (
        ""
      )}
      <br />
      <hr />
      <br />
      <h4>Sleeping arrangements</h4>
      <p>{rental.SleepingArrangements}</p>
      <br />
      <hr />
      <br />
      <h5>Amenities</h5>
      {rental.amenities}
    </div>
  );
};

export default RentalInfo;
